 function vestua(id){
    let data= {};
    
    let ids= browsing.filter(e => e.entityId === id);
    
    let impression= ids.filter(e => e.eventType === 'impression');
    
    let click= ids.filter(e => e.eventType === 'click');
    
    let ctr= click.length / impression.length;
    
    data['productId']= ids[0].entityId;
    data['impressions']= impression.length;
    data['clicks']= click.length;
    data['ctr']= ctr;
    
       return data
    };
    
    
